import React, { useEffect, useState } from 'react';

const TaskList = () => {
  const [tasks, setTasks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchTasks = async () => {
      try {
        const userId = localStorage.getItem('id');
        const token = localStorage.getItem('token');

        const response = await fetch('http://localhost:4000/api/v2/get-all-tasks', {
          method: 'GET',
          headers: {
            'Authorization': `Bearer ${token}`,
            'userId': userId, // Ensure this matches your backend
          },
        });

        if (!response.ok) {
          const errorData = await response.json();
          throw new Error(`Failed to fetch tasks: ${errorData.message}`);
        }

        const data = await response.json();
        setTasks(data.data);
      } catch (error) {
        console.error('Error fetching tasks:', error);
        setError(`Failed to fetch tasks: ${error.message}`);
      } finally {
        setLoading(false);
      }
    };

    fetchTasks();
  }, []);

  const handleDelete = async (taskId) => {
    try {
      const userId = localStorage.getItem('id');
      const token = localStorage.getItem('token');

      const response = await fetch(`http://localhost:4000/api/v2/delete-task/${taskId}`, {
        method: 'DELETE',
        headers: {
          'Authorization': `Bearer ${token}`,
          'userId': userId, // Ensure this matches your backend
        },
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(`Failed to delete task: ${errorData.message}`);
      }

      setTasks(tasks.filter(task => task._id !== taskId));
    } catch (error) {
      console.error('Error deleting task:', error);
      alert(`Failed to delete task: ${error.message}`);
    }
  };

  if (loading) return <p>Loading tasks...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div>
      <h2>Task List</h2>
      <ul>
        {tasks.map(task => (
          <li key={task._id}>
            <h3>{task.title}</h3>
            <p>{task.desc}</p>
            <button onClick={() => handleDelete(task._id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TaskList;
